import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Home } from './pages/Home';
import { AnatomicalLocation } from './pages/AnatomicalLocation';
import { AddContent } from './pages/AddContent';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-[#f5f6f8]">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/location/:id" element={<AnatomicalLocation />} />
          <Route path="/location/:id/:tab" element={<AnatomicalLocation />} />
          <Route path="/add-content" element={<AddContent />} />
          {/* Route par d√©faut si aucune route ne correspond */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
